text:
Any suggestions for replacing Alexa, specifically an Echo Show, with a hackable device?<p>I&#x27;m getting tired of Amazon annoying me with suggestions (&quot;By the way, did you know...&quot;), and crippling my Amazon Music Subscription. Whereas, a few weeks before, it would just play the requested song, I now get &quot;Here&#x27;s a playlist with songs similar to XYZ&quot;, and a plug to upgrade my subscription.<p>Any suggestions how to replace the Echo Show&#x27;s functionality with a more open, hackable device?<p>I was thinking about hacking something together with Python and OpenAI&#x27;s Whisper for speech recognition, perhaps. But maybe someone has already done something like this?<p>The main features we&#x27;ve been using personally:<p>- &quot;Play &#x27;While My Guitar Gently Weeps&#x27; by The Beatles&quot;
- &quot;Add salt to the todo list&quot; sends a HTTP request to a shopping list that&#x27;s shared between family members (we use Dynalist)
- &quot;Drop-in at grandma&#x27;s&quot; to video call grandma&#x27;s Echo Show
